import React, { useState } from "react";
import { ServiceDropDown } from "./Navitems";
import { Link } from "react-router-dom";
import "./Dropdown.css";
function Dropdown() {
  return (
    <>
      <ul>
        {ServiceDropDown.map((item) => {
          return (
            <li key={item.id}>
              <Link to={item.path} className={item.cName}>
                {item.cName}
              </Link>
            </li>
          );
        })}
      </ul>
    </>
  );
}
export default Dropdown;
